import logo from './logo.svg';
import './App.css';
import { Router } from 'express';

function App() {
  return (
    <div className="App">
      <Router>
        <Route>
          <Route path='*' element={<h1></h1>}></Route>
        </Route>
      </Router>
    </div>
  );
}

export default App;
